DROP TABLE IF EXISTS `operation`;
CREATE TABLE `operation` (
  `id` int(10) unsigned NOT NULL auto_increment,
  `qcodo_class_id` int(10) unsigned default NULL,
  `qcodo_interface_id` int(10) unsigned default NULL,
  `name` varchar(100) default NULL,
  `protection_type_id` int(10) unsigned default NULL,
  `static_flag` tinyint(1) default NULL,
  `abstract_flag` tinyint(1) default NULL,
  `final_flag` tinyint(1) default NULL,
  `return_variable_id` int(10) unsigned default NULL,
  `additional_variable_id` int(10) unsigned default NULL,
  `first_version` varchar(40) default NULL,
  `last_version` varchar(40) default NULL,
  `short_description` text,
  `extended_description` text,
  `file_id` int(10) unsigned default NULL,
  PRIMARY KEY  (`id`),
  UNIQUE KEY `uq_operation_1` (`qcodo_class_id`,`qcodo_interface_id`,`name`),
  KEY `operation_qcodo_class_id_idx` (`qcodo_class_id`),
  KEY `operation_qcodo_interface_id_idx` (`qcodo_interface_id`),
  KEY `operation_protection_type_id_idx` (`protection_type_id`),
  KEY `operation_return_variable_id_idx` (`return_variable_id`),
  KEY `operation_additional_variable_id_idx` (`additional_variable_id`),
  KEY `operation_file_id_idx` (`file_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

