7),(635,23,NULL,'IncrementOffset',1,0,0,0,NULL,NULL,'0.3.12',NULL,'Increment the call stack offset by 1.','Increment the call stack offset by 1. This works in conjunction with Qcodo\'s error handling/reporting so that the correct file/line-number is displayed to the user.\r\n\r\nThe PHP default for exeception reporting would normally say that the \"throw Exception\" line is responsible for throwing the exception. While this is technically true, in reality, it was the line that called the containing function which is responsible.\r\n\r\nBy showing the file/line \"one level above\" in the call stack allows for more helpful exception reporting.\r\n\r\n<b>Note:</b> If you catch and rethrow the exception, be sure to call <i>IncrementOffset()</i> so the appropriate file/line is reported. See the description for QCallerException <http://api.qcodo.com/index.php/QCallerException> for an example.',317),(636,23,NULL,'DecrementOffset',1,0,0,0,NULL,NULL,'0.3.12',NULL,'Decrement the call stack offset by 1.','Decrement the call stack offset by 1. Typically, this method will not be used unless you wish to trace the thrown exception <i>lower</i> in the call stack.',317),(637,174,NULL,'__construct',1,0,0,0,NULL,NULL,'0.3.12',NULL,'The constructor of QUndefinedPrimaryKeyException.','',317),(638,175,NULL,'__construct',1,0,0,0,NULL,NULL,'0.3.12',NULL,'The constructor of QIndexOutOfRangeException.','The constructor of QIndexOutOfRangeException. It accepts the out-of-range index and a message string and sets a sensible exception message.',317),(639,176,NULL,'__construct',1,0,0,0,NULL,NULL,'0.3.12',NULL,'The constructor of QUndefinedPropertyException.','The constructor of QUndefinedPropertyException. Creates and sets the exception message using the passed type (get or set), class name and property name.',317),(640,177,NULL,'__construct',1,0,0,0,NULL,NULL,'0.3.12',NULL,'The constructor of QOptimisticLockingException.','The constructor of QOptimisticLockingException. Generates a more context