,NULL,NULL,NULL,217),(18,17,NULL,4,'QImageLabel',0,0,'0.3.12',NULL,NULL,NULL,171),(19,NULL,NULL,2,'QErrorAttribute',0,NULL,'0.3.12',NULL,NULL,NULL,175),(20,8,NULL,4,'QBlockControl',1,0,'0.3.12',NULL,NULL,NULL,200),(21,20,NULL,4,'QPanel',0,0,'0.3.12',NULL,NULL,NULL,177),(22,NULL,NULL,7,'QFontFamily',1,1,'0.3.12',NULL,'A QForm enumeration representing values for the css \'font-family\' property.','A QForm enumeration representing values for the css <i>font-family</i> property.\r\n\r\nfont-family specifies the font name of a box. In other words, it determines what font is used to render content.\r\n\r\nThis is typically a comma-separated list, of which the browser will use the first font it recognizes. Font names that are made up of more than one word must be placed within quotation marks. <i>QFontFamily</i> takes care of this for you.',178),(23,93,NULL,11,'QCallerException',0,NULL,'0.3.12',NULL,'This is the main exception to be thrown by any method to indicate that the CALLER is responsible for causing the exception.','This is the main exception to be thrown by any method to indicate that the <b>caller</b> is responsible for causing the exception. This works in conjunction with Qcodo\'s error handling/reporting so that the correct file/line-number is displayed to the user.\r\n\r\nFor example, for a class that contains the method <i>GetItemAtIndex($intIndex)</i>, it is conceivable that the method\'s caller could pass an invalid parameter as <i>GetItemAtIndex(15)</i>, where 15 does not exist. <i>GetItemAtIndex()</i> would then throw a <i>QIndexOutOfRangeException</i> (which extends <i>QCallerException</i>). If the <i>QCallerException</i> is not caught, then the exception will be reported to the user. The <b>caller</b>, or the script who <b>called</b> <i>GetItemAtIndex()</i>, would have that line highlighted as being responsible for calling the error.\r\n\r\nThe PHP default for exeception reporting would normally say that the \"throw Exception\" line in <i>GetItemAtIndex()</i> is responsible for throwing the exception. While this is technically true, in reality, it was the line that <b>called</b> <i>GetItemAtIndex()</i> which is responsible. This allows for much cleaner exception reporting.\r\n\r\nAs a more in-depth example, suppose a method <i>OuterMethod()</i> takes in parameters and ends up passing those paremeters directly into another method <i>InnerMethod()</i> which could throw a <i>CallerException</i>.  <i>OuterMethod()</i> is responsible for catching and rethrowing the caller exception.  And when this is done, <i>IncrementOffset()</i> <b>must</b> be called on the exception object in order to indicate that <i>OuterMethod()</i>\'s <b>caller</b> is responsible for the exception.\r\n\r\nSo the code snippet to call <i>InnerMethod()</i> by <i>OuterMethod()</i> should look like:\r\n\r\n<code>\r\nfunction OuterMethod($mixValue) {\r\n    try {\r\n        InnerMethod($mixValue);\r\n    } catch (CallerException $objExc) {\r\n        $objExc->IncrementOffset();\r\n        throw $objExc;\r\n    }\r\n    // Do Other Stuff\r\n}\r\n</code>\r\n\r\nAgain, calling <i>IncrementOffset()</i> and rethrowing the exception assures the user that the line of code actually responsible for the exception is properly being reported by the Qcodo error reporting/handler.',317),(24,23,NULL,4,'QCrossScriptingException',0,0,'0.3.12',NULL,NULL,NULL,179),(25,8,NULL,4,'QPaginatedControl',1,0,'0.3.12',NULL,NULL,NULL,194),(26,25,NULL,4,'QDataRepeater',0,0,'0.3.12',NULL,NULL,NULL,180),(27,30,NULL,4,'QControlGrouping',1,0,'0.3.12',NULL,NULL,NULL,186),(28,27,NULL,4,'QDropZoneGrouping',0,0,'0.3.12',NULL,NULL,NULL,181),(29,8,NULL,4,'QDateTimePicker',0,0,'0.3.12',NULL,NULL,NULL,182),(30,NULL,NULL,2,'QBaseClass',1,NULL,'0.3.12',NULL,'The base class for all classes in the Qcodo development framework.','This is the base class for all classes in the Qcodo framework. It provides fundamental error handling of property getters and setters and a final function for setting a list of object properties via OverrideAttribute.\r\n\r\n<b>Note</b>\r\nAs of 2/13/07 there are two class methods missing from this api documentation: __get() and __set(). Each subclass of QBaseClass should override these default property accessor methods, and refer to parent::__get() in a try-catch block to handle QCallerException throwing. For example, most Qcodo classes will define something like:\r\n\r\n<code>\r\n		public function __get($strName) {\r\n			switch ($strName) {\r\n				case \'MyProperty01\':\r\n					return $this->MyProperty01;\r\n				case \'MyProperty02\':\r\n					return $this->MyProperty02;\r\n				default:\r\n					try {\r\n						return parent::__get($strName);\r\n					} catch (QCallerException $objExc) {\r\n						$objExc->IncrementOffset();\r\n						throw $objExc;\r\n					}\r\n			}\r\n		}   \r\n</code>\r\n\r\nIt is recommended you follow this pattern in your own getters and setters. Specifically, resorting to the try/catch block like the above example for handling attempts to get/set undefined properties.',321),(31,30,NULL,4,'QListItemStyle',0,0,'0.3.12',NULL,NULL,NULL,184),(32,30,NULL,4,'QListItem',0,0,'0.3.12',NULL,NULL,NULL,185),(33,16,NULL,4,'QFloatTextBox',0,0,'0.3.12',NULL,NULL,NULL,187),(34,8,NULL,4,'QFileControl',0,0,'0.3.12',NULL,NULL,NULL,188),(35,30,NULL,6,'QEvent',1,0,'0.3.12',NULL,'The base class for all Qcodo events.','The base class for all Qcodo events. This class declares the boilerplate for all Qcodo events, such as the corresponding Javascript event name, optional conditions (for more complex events like capturing particular key events), and optional delay.\r\n\r\nIn essence, all QEvents are abstractions of client-side javascript events.',189),(36,35,NULL,6,'QBlurEvent',0,0,'0.3.12',NULL,'QEvent class representing a browser \'blur\' event.','QEvent class representing a browser \'blur\' event.',189),(37,35,NULL,6,'QChangeEvent',0,0,'0.3.12',NULL,'QEvent class representing the browser \'change\' event.','QEvent class representing the browser \'change\' event.',189),(38,35,NULL,6,'QClickEvent',0,0,'0.3.12',NULL,'QEvent class representing a browser \'click\' event.','QEvent class representing a browser \'click\' event.',189),(39,35,NULL,6,'QDoubleClickEvent',0,0,'0.3.12',NULL,'QEvent class representing a browser \'dblclick\' event.','QEvent class representing a browser \'dblclick\' event.',189),(40,35,NULL,6,'QDragDropEvent',0,0,'0.3.12',NULL,'QEvent representing the browser \'dragdrop\' event.','QEvent representing the browser \'dragdrop\' event.',189),(41,35,NULL,6,'QFocusEvent',0,0,'0.3.12',NULL,'QEvent class representing a browser \'focus\' event.','QEvent class representing a browser \'focus\' event.',189),(42,35,NULL,6,'QKeyDownEvent',0,0,'0.3.12',NULL,'QEvent class representing a browser \'keydown\' event.','QEvent class representing a browser \'keydown\' event.',189),(43,35,NULL,6,'QKeyPressEvent',0,0,'0.3.12',NULL,'QEvent class representing a browser \'keypress\' event.','QEvent class representing a browser \'keypress\' event.',189),(44,35,NULL,6,'QKeyUpEvent',0,0,'0.3.12',NULL,'QEvent class representing a browser \'keyup\' event.','QEvent class representing a browser \'keyup\' event.',189),(45,35,NULL,6,'QMouseDownEvent',0,0,'0.3.12',NULL,'QEvent class representing a browser \'mousedown\' event.','QEvent class representing a browser \'mousedown\' event.',189),(46,35,NULL,6,'QMouseMoveEvent',0,0,'0.3.12',NULL,'QEvent class representing a browser \'mousemove\' event.','QEvent class representing a browser \'mousemove\' event.',189),(47,35,NULL,6,'QMouseOutEvent',0,0,'0.3.12',NULL,'QEvent class representing a browser \'mouseout\' event.','QEvent class representing a browser \'mouseout\' event.',189),(48,35,NULL,6,'QMouseOverEvent',0,0,'0.3.12',NULL,'QEvent class representing a browser \'mouseover\' event.','QEvent class representing a browser \'mouseover\' event.',189),(49,35,NULL,6,'QMouseUpEvent',0,0,'0.3.12',NULL,'QEvent class representing a browser \'mouseup\' event.','QEvent class representing a browser \'mouseup\' event.',189),(50,35,NULL,6,'QMoveEvent',0,0,'0.3.12',NULL,'QEvent class representing a \'qcodomove\' event.','QEvent class representing a \'qcodomove\' event. This event wraps the traditional \'move\' event with additional functionality.',189),(51,35,NULL,6,'QResizeEvent',0,0,'0.3.12',NULL,'QEvent class representing a \'qcodoresize\' event.','QEvent class representing a \'qcodoresize\' event.',189),(52,35,NULL,6,'QSelectEvent',0,0,'0.3.12',NULL,'QEvent class representing a browser \'select\' event.','QEvent class representing a browser \'select\' event.',189),(53,42,NULL,6,'QEscapeKeyEvent',0,0,'0.3.12',NULL,'QKeyDownEvent (QKeyPressEvent for Mac) class that represents the \'keypress\' (\'keydown\') event of the escape key.','QKeyDownEvent (QKeyPressEvent for Mac) class that represents the \'keypress\' (\'keydown\') event of the escape key.',189),(54,42,NULL,6,'QUpArrowKeyEvent',0,0,'0.3.12',NULL,'QKeyDownEvent (QKeyPressEvent for Mac) class that represents the \'keypress\' (\'keydown\') event of the up arrow.','QKeyDownEvent (QKeyPressEvent for Mac) class that represents the \'keypress\' (\'keydown\') event of the up arrow.',189),(55,42,NULL,6,'QDownArrowKeyEvent',0,0,'0.3.12',NULL,'QKeyDownEvent (QKeyPressEvent for Mac) class that represents the \'keypress\' (\'keydown\') event of the down arrow.','QKeyDownEvent (QKeyPressEvent for Mac) class that represents the \'keypress\' (\'keydown\') event of the down arrow.',189),(56,42,NULL,6,'QEnterKeyEvent',0,0,'0.3.12',NULL,'QKeyDownEvent (QKeyPressEvent for Mac) class that represents the \'keypress\' (\'keydown\') event of the enter key.','QKeyDownEvent (QKeyPressEvent for Mac) class that represents the \'keypress\' (\'keydown\') event of the enter key.',189),(57,NULL,NULL,7,'QBorderStyle',1,1,'0.3.12',NULL,'A QForm enumeration representing values for the css \'border-style\' property.','A QForm enumeration representing values for the css <i>border-style</i> property.\r\n\r\n<i>border-style</i> specifies the style of an element\'s complete border.\r\n\r\nPossible css values include:\r\n** <i>none</i>\r\n** <i>dotted</i>\r\n** <i>dashed</i>\r\n** <i>solid</i>\r\n** <i>double</i>\r\n** <i>groove</i>\r\n** <i>ridge</i>\r\n** <i>inset</i>\r\n** <i>outset</i>',190),(58,NULL,NULL,7,'QDisplayStyle',1,1,'0.3.12',NULL,'A QForm enumeration representing values for the css \'display\' property.','A QForm enumeration representing values for the css <i>display</i> property.\r\n\r\n<i>display</i> specifies the display type of a box (as in the CSS <i>box model</i>).',190),(59,NULL,NULL,7,'QTextAlign',1,1,'0.3.12',NULL,'A QForm enumeration representing values for the css \'text-align\' property.','A QForm enumeration representing values for the css <i>text-align</i> property.\r\n\r\n<i>text-align</i> specifies the alignment of text inside a box.',190),(60,NULL,NULL,7,'QRepeatDirection',1,1,'0.3.12',NULL,'A QForm enumeration representing values for a QListControl\'s visual direction.','',190),(61,NULL,NULL,7,'QGridLines',1,1,'0.3.12',NULL,'A QForm enumeration representing values for a table\'s \'rules\' attribute.','A QForm enumeration representing values for a table\'s <i>rules</i> attribute.\r\n\r\nThe <i>rules</i> attribute specifies the type of grid lines rendered in a table.',190),(62,NULL,NULL,7,'QSelectionMode',1,1,'0.3.12',NULL,'A QForm enumeration representing a select element\'s \'multiple\' property.','',190),(63,NULL,NULL,7,'QTextMode',1,1,'0.3.12',NULL,'A QForm enumeration representing types of text input modes.','',190),(64,NULL,NULL,7,'QHorizontalAlign',1,1,'0.3.12',NULL,'A QForm enumeration representing values of horizontal alignment.','',190),(65,NULL,NULL,7,'QVerticalAlign',1,1,'0.3.12',NULL,'A QForm enumeration representing types of vertical alignment.','',190),(66,NULL,NULL,7,'QBorderCollapse',1,1,'0.3.12',NULL,'A QForm enumeration representing values for the css \'border-collapse\' property.','A QForm enumeration representing values for the css <i>border-collapse</i> property.\r\n\r\n<i>border-collapse</i> specifies which border model should be used in a table.\r\n\r\nPossible css values include:\r\n** <i>collapse</i> \"collapsing borders\" model - cells share adjacent borders.\r\n**<i>separate</i> (default) \"separated borders\" model - cells have their own borders.\r\nNote that enumeration values and css property values differ.',190),(67,NULL,NULL,7,'QDateTimePickerType',1,1,'0.3.12',NULL,'A QForm enumeration representing the the type of QDateTimePicker.','A QForm enumeration representing the the type of QDateTimePicker (an unintentionally obvious explanation).\r\n\r\nIf your interface needs a date/time picker, you can customize what fields are rendered as UI. So if you just need a date picker, you can tell your QDateTimePicker to just display itself as a month/day/year control. If you just want a time picker, you can tell QDateTimePicker to just render an hour/minute control. And so on.',190),(68,NULL,NULL,7,'QCalendarType',1,1,'0.3.12',NULL,'A QForm enumeration representing values for different types of QCalendar control.','A QForm enumeration representing values for different types of QCalendar control. Use these values to specify how you would like your QCalendar to be rendered.\r\n\r\nExample:\r\n\r\n<code>\r\n$this->cal = new QCalendar($this);\r\n$this->cal->CalendarType = QCalendarType::TimeOnly; // just display the time picker\r\n</code>',190),(69,NULL,NULL,7,'QDateTimePickerFormat',1,1,'0.3.12',NULL,'A QForm enumeration representing the day, month, year order of a QDateTimePicker control.','A QForm enumeration representing the day, month, year order of a QDateTimePicker control.',190),(70,NULL,NULL,7,'QCrossScripting',1,1,'0.3.12',NULL,'A QForm enumeration representing types of allowable text input.','A QForm enumeration representing types of allowable text input. From most to least strict, those types are:\r\n** Deny\r\n** HtmlEntities\r\n** Allow',190),(71,NULL,NULL,7,'QCallType',1,1,'0.3.12',NULL,'A QForm enumeration representing call types (eg, Ajax or Server).','A QForm enumeration representing call types (eg, Ajax or Server).\r\n\r\nUsed internally by *Base classes when determining rendering behavior.',190),(72,NULL,NULL,7,'QPosition',1,1,'0.3.12',NULL,'A QForm enumeration representing values for the css \'position\' property.','A QForm enumeration representing values for the css \'position\' property.\r\n\r\nFor more about position behavior, see <http://www.w3.org/TR/REC-CSS2/visuren.html#choose-position>',190),(73,NULL,NULL,7,'QResizeHandleDirection',1,1,'0.3.12',NULL,'A QForm enumeration representing types of visual resize handles.','',190),(74,NULL,NULL,7,'QCursor',1,1,'0.3.12',NULL,'A QForm enumeration representing values for the css cursor property.','A QForm enumeration representing values for the css <i>cursor</i> property.\r\n\r\n<i>cursor</i> Specifies the appearance of the cursor when it passes over an element.',190),(75,NULL,NULL,7,'QOverflow',1,1,'0.3.12',NULL,'A QForm enumeration representing values for the css \'overflow\' property.','A QForm enumeration representing values for the css <i>overflow</i> property.\r\n\r\nSpecifies what should happen to the overflow - the portions of content that do not fit inside a box.',190),(76,NULL,NULL,7,'QCausesValidation',1,1,'0.3.12',NULL,'A QForm enumeration representing possible validation behavior.','A QForm enumeration representing possible validation behavior.\r\n\r\nFor more advanced users, note that <b>CausesValidation</b> can also be set to <i>QCausesValidation::SiblingsAndChildren</i> or <i>QCausesValidation::SiblingsOnly</i>. This functionality is geared for developers who are creating more complex QForms with child controls (either dynamically created, via custom composite controls, custom QPanels, etc). This allows for more finely-tuned direction in specifying a subset of controls that should be validated, instead of validating all controls on the form.\r\n\r\n<i>SiblingsAndChildren</i> specifies the validation of all sibling controls, and their children, of the control that is triggering the action, while <i>SiblingsOnly</i> specifies the validation of the triggering control\'s siblings <b>only</b>.\r\n\r\nQforms will go through a validation process just before it executes any Server-based actions, if needed. If the QControl that triggers the QServerAction has its <b>CausesValidation</b> property set to \"true\", then before executing the QServerAction the QForm will go through every visible control in the entire QForm and call <i>Validate()</i>. Only after ensuring that every control is valid, will the QForm go ahead and execute the assigned QServerAction.\r\n\r\nOtherwise, every QControl whose <i>Validate()</i> fails will have its <b>ValidationError</b> property	set with the appropriate error message.\r\n\r\nWhat the validation checks for is dependent on the control you are using. In general, QControls that have their <b>Required</b> property set to \"true\" will check to ensure that data was at least entered or selected.\r\n\r\nSome controls have additional rules.',190),(77,8,NULL,4,'QCalendar',0,0,'0.3.12',NULL,NULL,NULL,191),(78,30,NULL,5,'QAction',1,0,'0.3.12',NULL,NULL,NULL,192),(79,78,NULL,5,'QServerAction',0,0,'0.3.12',NULL,NULL,NULL,192),(80,78,NULL,5,'QAjaxAction',0,0,'0.3.12',NULL,NULL,NULL,192),(81,79,NULL,5,'QServerControlAction',0,0,'0.3.12',NULL,NULL,NULL,192),(82,80,NULL,5,'QAjaxControlAction',0,0,'0.3.12',NULL,NULL,NULL,192),(83,78,NULL,5,'QJavaScriptAction',0,0,'0.3.12',NULL,NULL,NULL,192),(84,78,NULL,5,'QConfirmAction',0,0,'0.3.12',NULL,NULL,NULL,192),(85,78,NULL,5,'QAlertAction',0,0,'0.3.12',NULL,NULL,NULL,192),(86,78,NULL,5,'QResetTimerAction',0,0,'0.3.12',NULL,NULL,NULL,192),(87,78,NULL,5,'QTerminateAction',0,0,'0.3.12',NULL,NULL,NULL,192),(88,78,NULL,5,'QToggleDisplayAction',0,0,'0.3.12',NULL,NULL,NULL,192),(89,78,NULL,5,'QToggleEnableAction',0,0,'0.3.12',NULL,NULL,NULL,192),(90,78,NULL,5,'QRegisterClickPositionAction',0,0,'0.