By default, Qcodo will check the session to determine which language and country is currently being used, but it is really up to the developer to determine how you want the language and country codes get discovered (e.g., via the URL, via GET arguments, etc.)\r\n\r\nLanguage files are in the GNU PO format (see <http://www.gnu.org/software/gettext/manual/html_node/gettext_9.html> for more information) and are placed in the <i>/includes/i18n</i> directory.\r\n\r\n<b>To translate any piece of text, simply use <i>QApplication::Translate($yourvar)</i>.</b> Or as a shortcut, if you want to do a PHP <i>print()</i> of any translated text in your template, you can use the Qcodo printing shortcut <i>_t($yourvar)</i>, which does the equivalent of <i>print(QApplication::Translate($yourvar))</i>.\r\n\r\nNote that generated Form Drafts and the QControls are all I18n aware -- they will translate themselves based on the selected language as long as the appropriate language file exists. Qcodo-specific language files are part of Qcodo core, and exist in <i>includes/qcodo/i18n</i>.\r\n\r\n<b>Please Note:</b> we are desperately in need of more language files. If you are able to contribute please take the current <i>en.po</i> file and translate it to any currently unsupported language and feel free to submit it. Also note that the Spanish translation <i>es.po</i> language files (both in the example and in Qcodo core) need to be corrected.\r\n\r\nFinally, due to the heavy processing of PO parsing, the results of the PO parsing are cached using QCache, and cached files are stored in <i>includes/cache/i18n</i>.',310),(160,30,NULL,10,'QRssFeed',0,NULL,'0.3.12',NULL,NULL,NULL,311),(161,30,NULL,10,'QRssImage',0,NULL,'0.3.12',NULL,NULL,NULL,311),(162,30,NULL,10,'QRssCategory',0,NULL,'0.3.12',NULL,NULL,NULL,311),(163,30,NULL,10,'QRssItem',0,NULL,'0.3.12',NULL,NULL,NULL,311),(164,NULL,NULL,2,'QString',1,NULL,'0.3.12',NULL,'An abstract utility class for string manipulation.','An abstract utility class for string manipulation. Note that all methods are static. This class encapsulates a handful of grunt string manipulation tools, such as \'return the last char of a string.\'',312),(165,30,NULL,8,'QDatabaseForeignKey',0,NULL,'0.3.12',NULL,NULL,NULL,313),(166,30,NULL,8,'QDatabaseIndex',0,NULL,'0.3.12',NULL,NULL,NULL,313),(167,NULL,NULL,8,'QDatabaseFieldType',1,NULL,'0.3.12',NULL,NULL,NULL,313),(168,30,NULL,2,'QCache',0,NULL,'0.3.12',NULL,NULL,NULL,314),(169,NULL,NULL,2,'QUpdateUtility',0,NULL,'0.3.12',NULL,NULL,NULL,315),(170,NULL,NULL,2,'QDirectoryToken',0,NULL,'0.3.12',NULL,NULL,NULL,315),(171,30,NULL,10,'QSoapParameter',0,NULL,'0.3.12',NULL,NULL,NULL,316),(172,30,NULL,10,'QSoapMethod',0,NULL,'0.3.12',NULL,NULL,NULL,316),(173,30,NULL,10,'QSoapService',0,NULL,'0.3.12',NULL,'This class allows you to very easily add SOAP-enabled PHP methods to your application.','The Qcodo <b>QSoapService</b> class allows you to very easily add SOAP-enabled PHP methods to your application.\r\n\r\nIt utilizes the <i>SoapServer</i> class in PHP 5.1 or greater (and subsequently, this specific example also uses the <i>SoapClient</i> class to illustrate the <b>QSoapService</b> in action). However, <b>QSoapService</b> adds a significant level of functionality, overcoming most of the inherent issues found in the PHP <i>SoapServer</i>, including:\r\n\r\n** Full, Automatic WSDL Generation\r\n** Supports parameters that are Pass By Reference\r\n** Supports <b>QDateTime</b>, arrays and other input/output parameters that are complex data structures\r\n** And of course, full support for code generated data objects\r\n\r\nTo use, simply create a class which extends from <b>QSoapService</b>, and define any public methods as you would any other class (static, private and protected methods can be defined in this class as well, but they will not be exposed as publically available webservice methods).\r\n\r\nPlease note is that because SOAP by definition is a strongly-typed protocol, and because PHP is not, you must declare the types of the input and output parameters for each webservice-enabled method.  This is done through standard PHPDoc tags.  Please view the example code:\r\n\r\n<http://examples.qcodo.com/examples/communication/soap.php>\r\n\r\nAnd finally, due to the heavy processing of WSDL generation, the results of the WSDL generation are cached using <b>QCache</b> and cached files are stored in <i>/includes/cache/soap</i>.',316),(174,23,NULL,11,'QUndefinedPrimaryKeyException',0,NULL,'0.3.12',NULL,'This exception is thrown when a data object\'s primary key is invalid.','This exception is thrown by a data object operation when it checks the primary key (eg, <i>$intId</i>) and finds it to be invalid.',317),(175,23,NULL,11,'QIndexOutOfRangeException',0,NULL,'0.3.12',NULL,'This exception is thrown to indicate an out-of-range index for a particular array.','This exception is thrown to indicate an out-of-range index for a particular array. Note that unlike it\'s parent QCallerException, QIndexOutOfRangeException\'s constructor takes the bad index and a message string, and starts with a call stack offset of 2.\r\n\r\nFor more information on the call stack offset, see QCallerException.',317),(176,23,NULL,11,'QUndefinedPropertyException',0,NULL,'0.3.12',NULL,'The exception thrown when attempting to get or set an invalid object property .','The exception thrown by QBaseClass\' and QDateTime\'s <i>__get()</i> and <i>__set()</i> override methods when attempting to get or set an invalid object property.',317),(177,23,NULL,11,'QOptimisticLockingException',0,NULL,'0.3.12',NULL,'This exception is thrown when a lock condition is encountered.','This exception is thrown when a lock condition is encountered. To override optimistic locking, call <i>Save()</i> with <i>$blnForceUpdate</i> set to true.',317),(178,23,NULL,11,'QRemoteAdminDeniedException',0,NULL,'0.3.12',NULL,'This exception is thrown when remote admin is disabled and an attempt is made to access an admin page.','This exception is thrown when remote admin is FALSE and an attempt is made to access an admin page (eg, form_drafts, codegen, or any script that calls <i>QApplicationBase::CheckRemoteAdmin()</i>) from any host other than localhost.\r\n\r\nTo allow remote access to a script, set the <i>ALLOW_REMOTE_ADMIN</i> constant in <i>configuration.inc.php</i> to TRUE.\r\n\r\nSee <i>configuration.inc.php</i> and <i>QApplicationBase::CheckRemoteAdmin()</i> for more additional information.',317),(179,30,NULL,9,'QQBaseNode',1,NULL,'0.3.12',NULL,NULL,NULL,318),(180,179,NULL,9,'QQNode',0,NULL,'0.3.12',NULL,NULL,NULL,318),(181,180,NULL,9,'QQReverseReferenceNode',0,NULL,'0.3.12',NULL,NULL,NULL,318),(182,179,NULL,9,'QQAssociationNode',0,NULL,'0.3.12',NULL,NULL,NULL,318),(183,180,NULL,9,'QQNamedValue',0,NULL,'0.3.12',NULL,NULL,NULL,318),(184,30,NULL,9,'QQCondition',1,NULL,'0.3.12',NULL,NULL,NULL,318),(185,184,NULL,9,'QQConditionAll',0,NULL,'0.3.12',NULL,NULL,NULL,318),(186,184,NULL,9,'QQConditionNone',0,NULL,'0.3.12',NULL,NULL,NULL,318),(187,184,NULL,9,'QQConditionLogical',1,NULL,'0.3.12',NULL,NULL,NULL,318),(188,187,NULL,9,'QQConditionOr',0,NULL,'0.3.12',NULL,NULL,NULL,318),(189,187,NULL,9,'QQConditionAnd',0,NULL,'0.3.12',NULL,NULL,NULL,318),(190,184,NULL,9,'QQConditionNot',0,NULL,'0.3.12',NULL,NULL,NULL,318),(191,184,NULL,9,'QQConditionComparison',1,NULL,'0.3.12',NULL,NULL,NULL,318),(192,191,NULL,9,'QQConditionIsNull',0,NULL,'0.3.12',NULL,NULL,NULL,318),(193,191,NULL,9,'QQConditionIsNotNull',0,NULL,'0.3.12',NULL,NULL,NULL,318),(194,191,NULL,9,'QQConditionIn',0,NULL,'0.3.12',NULL,NULL,NULL,318),(195,191,NULL,9,'QQConditionLike',0,NULL,'0.3.12',NULL,NULL,NULL,318),(196,191,NULL,9,'QQConditionEqual',0,NULL,'0.3.12',NULL,NULL,NULL,318),(197,191,NULL,9,'QQConditionNotEqual',0,NULL,'0.3.12',NULL,NULL,NULL,318),(198,191,NULL,9,'QQConditionGreaterThan',0,NULL,'0.3.12',NULL,NULL,NULL,318),(199,191,NULL,9,'QQConditionLessThan',0,NULL,'0.3.12',NULL,NULL,NULL,318),(200,191,NULL,9,'QQConditio