its dependent <b>QEmailMessage</b> class) allows the application to send messages via any accessible SMTP server. The <b>QEmailServer</b> class is an abstract class and <b>is not meant to be instantiated</b>. It has one public static method, <i>Send</i>, which takes in a QEmailMessage object. \r\n\r\nObviously, many PHP developers will be familiar with the PHP <i>mail()</i> function, which internally makes a shell call to <i>sendmail</i>.  But note that for many reasons (including security, maintenance and deployability), <b>QEmailServer does not use PHP\'s <i>mail()</i> nor does it use <i>sendmail</i></b>.\r\n\r\n<b>QEmailServer</b> is an abstract class that only has static variables (which define the location of the SMTP server, other preferences, etc) and a single static	<i>Send</i> method. The <i>Send</i> method takes in a <b>QEmailMessage</b> object.\r\n\r\nThe <b>QEmailMessage</b> object contains the relavent email addresses (e.g. From, To, Cc and Bcc), as well as the subject and body.  Note that the body can be in either plain text, HTML or both.  Qcodo will automatically handle the multipart message encoding for you.\r\n\r\nFinally, note that for development environments that do not have ready access to an SMTP server, the <b>QEmailServer</b> can be set to <i>TestMode</i>, where communication between the application and the SMTP server will be written to disk instead of an SMTP socket.  This allows developers to develop and test email capability without actually sending out any emails.\r\n\r\nSome examples of use:\r\n\r\n<code>\r\n// We want to define our email SMTP server (it defaults to \'localhost\')\r\n// This would typically be done in prepend.inc, and its value should probably be a constant\r\n// that is defined in _configuration.inc\r\n\r\nQEmailServer::$SmtpServer = \'mx.acme.com\';\r\n\r\n$objMessage = new QEmailMessage();\r\n// set message properties like to, from, subject, body\r\n\r\nQEmailServer::Send($objMessage);\r\n\r\n// or do it all on one line\r\n\r\nQEmailServer::Send(new QEmailMessage(\'reporting@acme.com\', \'jdoe@acme.com\', \'Alerts Received!\', $strBody));\r\n</code>',323),(222,23,NULL,10,'QEmailException',0,NULL,'0.3.12',NULL,'This exception is thrown to indicate errors from QEmailServer and sending e-mail.','This exception is thrown to indicate errors from QEmailServer and sending e-mail.',323),(223,30,NULL,10,'QEmailMessage',0,NULL,'0.3.12',NULL,'This class represents an e-mail message.','This class represents an e-mail message with typical properties and header information.\r\n\r\nThe <b>QEmailMessage</b> object contains the relevent email addresses (e.g. From, To, Cc and Bcc), as well as the subject and body.  Note that the body can be in either plain text, HTML or both.  Qcodo will automatically handle the multipart message encoding for you.\r\n\r\nIn addition, <b>QEmailMessage</b> supports an array of header key-value pairs.\r\n\r\nA very simple example:\r\n\r\n<code>\r\nQEmailServer::Send(new QEmailMessage(\'reports@acme.com\', \'jdoe@acme.com\', \'Alert!\', $strBody));\r\n</code>',323),(224,149,NULL,3,'QConvertNotation',1,NULL,'0.3.12',NULL,NULL,NULL,347),(225,78,NULL,5,'QCssClassAction',0,NULL,'0.3.14',NULL,'','',192),(226,8,NULL,4,'QControlProxy',0,NULL,'0.3.14',NULL,'','',405),(227,30,NULL,2,'QDateTimeSpan',0,NULL,'0.3.14',NULL,'','',406),(228,23,NULL,11,'QDateTimeNullException',0,NULL,'0.3.14',NULL,'This exception is thrown whenever an attempt is made to set a partial time (e.g. the \"Hour\", \"Minute\" or \"Second\" property) when the QDateTime object has a null time value, or whenever an attempt is made to set a partial date (e.g. the \"Year\", \"Month\" or \"Day\" property) when the QDateTime object has a null date value.','',320),(229,NULL,NULL,1,'DateTime',NULL,NULL,'0.3.14',NULL,NULL,NULL,NULL),(230,78,NULL,5,'QShowDialogBox',0,NULL,'0.3.18',NULL,'','',192),(231,78,NULL,5,'QHideDialogBox',0,NULL,'0.3.18',NULL,'','',192),(232,21,NULL,4,'QDialogBox',0,NULL,'0.3.18',NULL,'','',4